        <div style={{paddingTop: "200pt", paddingBottom: "200pt", background: "linear-gradient(50deg, rgb(50 11 206 / 70%)50%, rgb(39 38 40 / 98%)30%)", color: "white"}}> 
            <Container>
                <h1>Lorem ipsum dolor sit amet</h1>
